import { Link } from "react-router-dom";

const Header = () => {
    return ( 
        <div>
            <nav>
                <Link to = "/">Home</Link>
                <Link to = "/login">Login</Link>
                <Link to = "/signup">SignUp</Link>
                <Link to = "/employee">EmployeeDashboard</Link>
                <Link to = "/">EmployerDashboard</Link>
            </nav>
        </div> 
    );
}
 
export default Header;
